import React, { Component } from 'react';
import { profileRequest } from '../services/api'

class Profile extends Component {
    state = {
        username: '',
        deckBoxes: []
    }

    componentDidMount() {
        profileRequest().then(res => {
            if (!res.error) {
                this.setState({ username: res, deckBoxes: res.deckboxes})
            }
        })
    }
    render() {
        return (
            <div id="profile">
                <h1>Your Profile  </h1>
            </div>
        )
    }
}

export default Profile;
